import React from "react";
import "./App.css";
import JwtControler from "./Controlers/Jwt.controler";

function App() {
    var state = {
        jwtControler: new JwtControler(),
        token: "no token",
    };

    return (
        <div className="App">
            <label>{state.token}</label>
            <button
                onClick={() => {
                    this.setState();

                    state.jwtControler.authenticate("admin", "admin");
                    state.token = state.jwtControler.getToken();
                }}
            >
                It hurts
            </button>
        </div>
    );
}

export default App;
